        console.log(e.target.checked);
        setIsCheck(true);
    }

  return (
    <div>
        <div className="agree">
        [필수]만 14세 이상이며 모두 동의합니다
        <input type="checkbox" className="agreeInput" 
        onClick={isCheckConfirm}/>
        {
            //setIsCheck이 true면 가입하기 버튼 활성화
        }
      </div>
    </div>
  )
}
